export const HeaderLogo = () => (
  <div style={{ 
    display: 'flex', 
    justifyContent: 'center', 
    width: '100%' 
  }}>
    <img 
      src="/images/harvard_management_logo.png" 
      alt="Harvard Management Company" 
      style={{ 
        height: "auto", 
        width: "250px",
        margin: "10px 0",
        objectFit: "contain"
      }} 
    />
  </div>
);
